import './App.css'
import { 
  BrowserRouter,
  Routes,
  Route,
} from 'react-router-dom'

import Home from './components/Home'
import About from './components/About'
import Booking from './components/Booking'
import Header from './Header'
import Footer from './Footer'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Home />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
